import React from 'react'

import { useSelector } from 'react-redux'
import { useParams } from 'react-router-dom'

const Ship = () => {
  const id = useParams().id
  const ship = useSelector(state => state.ships[0])
  //const ship = useSelector(state => state.ships.find(ship => ship.id === id))

  if (!ship) {
    return null
  }

  //const own = user && user.username === ship.user.username

  return (
    <div className='ship'>
      <h3>{ship.name}</h3>
      <div>
        <div>{ship.built}</div>
        <div>length {ship.lengthMeters}</div>
      </div>
    </div>
  )
}

export default Ship
